import raw from './assets/LifeSimulation01.xml';

class map
{

      

      constructor()
      {
            this.map_height = 0;
            this.map_width = 0;
            this.plants = [];      
      }
      plant = {
          x: 0,
          y: 0,
      }
      get width() { return this.map_width }
      set width(num) { this.map_width = num }
      get height() { return this.map_height }
      set height(num) { this.map_height = num } 
      //get plants() { return this.plants }
      append_plants(x, y) {this.plants.push(this.plant(x,y))}
      get_a_plant() {
            this.temp = this.plants.pop();
            return [this.temp.x, this.temp.y]; 
      };
}

const map1 = new map();

fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  let lines =  text.split('\n');
                  map1.width = parseInt(lines[3]);
                  map1.height = parseInt(lines[6]);
                  map1.append_plants(parseInt(lines[30]), parseInt(lines[33]));
            })

export default map1;
